social_posts.post_text:
@wockeam is starting 11th grade. I am so excited for him - he stayed persistent and finally got into @osaschool 🎉💯🔥 because for him, music is life! 

Last week at orientation when his new principal asked him, what school do you come from, with pride Joaquin said, @cristoreydelasalle and asked “do you know about that school?” So, there you have it, he transfers from a community (loved the teachers, model, faith base education) that instilled confidence. We will always stay committed to your mission, thank you CRDLS 🥰!!! 

ln conclusion, (🤣 in honor of all the essays he will have to write) am so proud to be Joaquin’s mom and so excited about what is in store for him. OSA, here he comes! #osa #cristoreydelasalle #11thgrade #style #oakland #youth #musician #music #backtoschool

I like to show you all the great moments because, those are the moments that inspire. But let’s be real, the day to day journey is bumpy.

I’m here because I have an army of people that have not given up on me… for some strange reason. 🫣😬

@lbanstrong - I’m so honored. Thank you for the opportunity to learn from the best how to scale! #business #entrepreneur #scaling #stanford #lban #esoventures #mba
